using System;
using System.Threading.Tasks;
using System.Collections.Generic;
using System.Numerics;
using Nethereum.Hex.HexTypes;
using Nethereum.ABI.FunctionEncoding.Attributes;
using Nethereum.Web3;
using Nethereum.RPC.Eth.DTOs;
using Nethereum.Contracts.CQS;
using Nethereum.Contracts;
using System.Threading;

namespace EthereumPrototype.ContractAPI.TravelSystem.ContractDefinition
{


    public partial class TravelSystemDeployment : TravelSystemDeploymentBase
    {
        public TravelSystemDeployment() : base(BYTECODE) { }
        public TravelSystemDeployment(string byteCode) : base(byteCode) { }
    }

    public class TravelSystemDeploymentBase : ContractDeploymentMessage
    {
        public static string BYTECODE = "";
        public TravelSystemDeploymentBase() : base(BYTECODE) { }
        public TravelSystemDeploymentBase(string byteCode) : base(byteCode) { }
        [Parameter("address", "vehicleStorageAddress", 1)]
        public virtual string VehicleStorageAddress { get; set; }
    }

    public partial class DepatureFunction : DepatureFunctionBase { }

    [Function("depature")]
    public class DepatureFunctionBase : FunctionMessage
    {
        [Parameter("bytes32", "vehicleId", 1)]
        public virtual byte[] VehicleId { get; set; }
        [Parameter("int256", "destinationX", 2)]
        public virtual BigInteger DestinationX { get; set; }
        [Parameter("int256", "destinationY", 3)]
        public virtual BigInteger DestinationY { get; set; }
        [Parameter("uint256", "depatureTime", 4)]
        public virtual BigInteger DepatureTime { get; set; }
        [Parameter("int256", "speed", 5)]
        public virtual BigInteger Speed { get; set; }
    }

    public partial class GetPositionFunction : GetPositionFunctionBase { }

    [Function("getPosition", typeof(GetPositionOutputDTO))]
    public class GetPositionFunctionBase : FunctionMessage
    {
        [Parameter("bytes32", "vehicleId", 1)]
        public virtual byte[] VehicleId { get; set; }
        [Parameter("uint256", "time", 2)]
        public virtual BigInteger Time { get; set; }
    }

    public partial class StationFunction : StationFunctionBase { }

    [Function("station")]
    public class StationFunctionBase : FunctionMessage
    {
        [Parameter("bytes32", "vehicleId", 1)]
        public virtual byte[] VehicleId { get; set; }
        [Parameter("uint256", "time", 2)]
        public virtual BigInteger Time { get; set; }
    }



    public partial class GetPositionOutputDTO : GetPositionOutputDTOBase { }

    [FunctionOutput]
    public class GetPositionOutputDTOBase : IFunctionOutputDTO 
    {
        [Parameter("int256", "posX", 1)]
        public virtual BigInteger PosX { get; set; }
        [Parameter("int256", "posY", 2)]
        public virtual BigInteger PosY { get; set; }
    }


}
